import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { useHistory } from "react-router";

import { setMainColor, setMerchant, setMerchantID } from "@Redux";
import { merchantApi } from "@api";
import { IMerchant, IMerchantQRcode } from "@interfaces";
import { PATH_SIGN_IN_EMAIL } from "@configs";

export const PageTrafficSource = () => {
    //page hook
    const dispatch = useDispatch();
    const history = useHistory();

    useEffect(() => {
        merchantConfig();
    }, []);

    const merchantConfig = async () => {
        const res = await merchantApi.getMerchantId("80091ce4-05bb-46d1-b676-9298ea3c63ee");
        const data = res.data as IMerchantQRcode;
        dispatch(setMerchantID(data.merchantId));
        const merchantConfig = await merchantApi.getMerchantConfig();
        const merchant = merchantConfig.data.merchant as IMerchant;
        dispatch(setMerchant(merchant));
        dispatch(setMainColor(merchant.themeColor));
        history.push(PATH_SIGN_IN_EMAIL);
    };
    return <></>;
};
